import React from "react";
import { useEffect } from "react";
import { getEmailList } from "../services/EmailList";

function EmailList() {
  useEffect(() => {
    const fetchAllEmails = async () => {
      const data = await getEmailList();
      console.log(data);
    };

    fetchAllEmails();
  }, []);
  return <div>EmailList</div>;
}

export default EmailList;
